import React from 'react';
import './App.css';
import Home from './Containers/Home/Home';
import {BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App" style={{
      backgroundColor: 'blue',
      width: '100px',
      height: '100px'
    }}>
      <Router>
      <Routes>
            <Route path="/" element={ <Home />}/>
      </Routes>
      </Router>
    </div>
  );
}

export default App;
